export default (function(a,b,c,d){return {data:{xcvQZBLprX:{data:{id:1664,attributes:{imdbId:"tt1396484",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDVkZmI0YzAtNzdjYi00ZjhhLWE1ODEtMWMzMWMzNDA0NmQ4XkEyXkFqcGdeQXVyNzYzODM3Mzg@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.3\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"},{Source:"Metacritic",Value:"69\u002F100"}],item_lang:{data:{id:2327,attributes:{title:b,plot:"In the Town of Derry, the local kids are disappearing one by one. In a place known as 'The Barrens', a group of seven kids are united by their horrifying and strange encounters with an evil clown and their determination to kill It.",slug:"it"}}},books:{data:[{id:8611,attributes:{title:b,description:"In 1985, six men and one woman are called back together to search for a creature of unspeakable evil that had stalked them as children.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=S85NCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2016-01-05",publisher:"Simon and Schuster",subtitle:"A Novel"}},{id:8612,attributes:{title:b,description:"NOW A MAJOR MOTION PICTURE - Stephen King's terrifying classic. 'They float...and when you're down here with me, you'll float, too.' Derry, Maine is just an ordinary town: familiar, well-ordered for the most part, a good place to live. It is a group of children who see - and feel - what makes Derry so horribly different. In the storm drains, in the sewers, IT lurks, taking on the shape of every nightmare, each one's deepest dread. Sometimes is appears as an evil clown named Pennywise and sometimes IT reaches up, seizing, tearing, killing . . . Time passes and the children grow up, move away and forget. Until they are called back, once more to confront IT as IT stirs and coils in the sullen depths of their memories, emerging again to make their past nightmares a terrible present reality.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=W1X51dmarEUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2007-10-04",publisher:"Hachette UK",subtitle:"Film tie-in edition of Stephen King's IT"}},{id:8613,attributes:{title:b,description:"A thriller about a malevolent force in a small New England town that takes the shape of a clown, terrifying youngsters with their innermost fears and bringing them to untimely doom.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wvc6YgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2011-01-01",publisher:"Hodder & Stoughton Limited",subtitle:d}},{id:8614,attributes:{title:"It. Movie Tie-In",description:"Derry, Maine is just an ordinary town : familiar, well- ordered for the most part, a good place to live. It is a group of children who see - and feel - what makes Derry so horribly different. In the storm drains, in the sewers, IT lurks, taking on the shape of every nightmare, each one's deepest dread. Sometimes IT appears as an evil clown named Pennywise and sometimes IT reaches up, seizing, tearing, killing... Time passes and the children grow up, move away and forget. Until they are called back, once more to confront IT as IT stirs and coils in the sullen depths of their memories, emerging again to make their past nightmares a terrible present reality.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mk7JAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2017-07-25",publisher:"Hodder Paperbacks",subtitle:d}},{id:8615,attributes:{title:"If It Bleeds",description:"From #1 New York Times bestselling author, legendary storyteller, and master of short fiction Stephen King comes an extraordinary collection of four new and compelling novellas—Mr. Harrigan’s Phone, The Life of Chuck, Rat, and the title story If It Bleeds—each pulling you into intriguing and frightening places. The novella is a form King has returned to over and over again in the course of his amazing career, and many have been made into iconic films, including “The Body” (Stand By Me) and “Rita Hayworth and Shawshank Redemption” (Shawshank Redemption). Like Four Past Midnight, Different Seasons, and most recently Full Dark, No Stars, If It Bleeds is a uniquely satisfying collection of longer short fiction by an incomparably gifted writer.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4q7eDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2020-04-21",publisher:"Scribner",subtitle:d}}]}}},meta:{}}},prerenderedAt:1680940965337}}("Stephen King","It",null,""))